title: Mutual recursion in a chain of inheritance
description: >
  The defect manifests in the form of call chain cycles.
  The following cycles are present here:
  o3721.o3722.m1 -> o3725.m0 -> o3721.o3722.m1
  o3725.m0 -> o3721.o3722.m1 -> o3725.m0
  o3697.o3707.o3709.m0 -> o3735.m1 -> o3697.o3707.o3709.m0
  o3735.m1 -> o3697.o3707.o3709.m0 -> o3735.m1
  o3723.m9 -> o3753.m6 -> o3723.m8 -> o3753.m6
  o3753.m6 -> o3723.m8 -> o3753.m6
  o3723.m8 -> o3753.m6 -> o3723.m8
  o3735.m1 -> o3780.m0 -> o3735.m1
  o3780.m0 -> o3735.m1 -> o3780.m0

features:
  - inheritance
  - overriding
  - method
  - polymorphism

